import "../css/DivUsers.css";
import React from 'react';
import { styled } from '@mui/material/styles';
import Button, { ButtonProps } from '@mui/material/Button';
import { purple } from '@mui/material/colors';

function DivUsers() {

    const ColorButton = className="Button"<ButtonProps>(({ theme }) => ({
      color: theme.palette.getContrastText(purple[500]),
      backgroundColor: purple[500],
      '&:hover': {
        backgroundColor: purple[700],
      },
    }));

  return (
  <div>
  <div className="container col-xxl-8 px-4 py-5">
    <div className="row flex-lg-row-reverse align-items-center g-5 py-5">
      <div className="col-10 col-sm-8 col-lg-6">
        <img src="https://elcomercio.pe/resizer/A_I4P69SAvd0y5SrCer9K3LavKE=/580x330/smart/filters:format(jpeg):quality(75)/cloudfront-us-east-1.images.arcpublishing.com/elcomercio/6B6WDTELIJHVLAKNB7MDOUFVIU.jpg" className="d-block mx-lg-auto img-fluid" alt="Bootstrap Themes" width="700" height="500" loading="lazy"/>
      </div>
      <div className="col-lg-6">
        <h1 className="display-5 fw-bold lh-1 mb-3">I'm freelace</h1>
        <p className="lead">Meet clients you’re excited to work with and take your career or business to new heights..</p>
        <div className="d-grid gap-2 d-md-flex justify-content-md-start">
          <button type="button" className="btn btn-primary btn-lg px-4 me-md-2">Find Job</button>
          <button type="button" className="btn btn-outline-secondary btn-lg px-4">Log In</button>
        </div>
      </div>
    </div>
  </div>
  <div className="container col-xxl-8 px-4 py-5">
  <div className="row flex-lg-row align-items-center g-5 py-5">
    <div className="col-10 col-sm-8 col-lg-6">
      <img src="https://s3.amazonaws.com/semanaeconomica.bucket/semanaeconomica2/articles/banner/30267_1621138909_banner.jpg" className="d-block mx-lg-auto img-fluid" alt="Bootstrap Themes" width="700" height="500" loading="lazy"/>
    </div>
    <div className="col-lg-6">
      <h1 className="display-5 fw-bold lh-1 mb-3">I'm recruiter</h1>
      <p className="lead">Work with the largest network of independent professionals and get things done—from quick turnarounds to big transformations.
      </p>
      <div className="d-grid gap-2 d-md-flex justify-content-md-start">
      <ColorButton variant="contained">Custom CSS</ColorButton>

      </div>
    </div>
  </div>
</div>
</div>
  );
}
  
export default DivUsers;
